import { Link,Switch, Route } from "react-router-dom";
import Topics from "./topics"
import Footer from "./Footer";
import Header from "./Header";
import NotFound from "./NotFound";
import Profile from './Profile';
import ProtectedRoute from "./ProtectedRoute";
import { useHistory } from 'react-router-dom';
import { useEffect, useState } from "react";
import { F1 } from "./Utility";
import Test from "./Destructured";
import Auth from "./NavigateToFromLogin";

function  Launch()
{
      debugger;
      const [email, setEmail] = useState("")
      const history = useHistory(); 
      const {SignIn, SignOut} = Auth();

   useEffect(()=>{
      if(sessionStorage.getItem("email")!=null)
      {
            setEmail(sessionStorage.getItem("email"));
      }
      else
      {
            setEmail("");
      }
   }, []);

   const ShowButton =()=>{
      if(email == "")
      {
            return  <button className='btn btn-warning' onClick={SignIn}>Log In</button>
      }
      else
      {
            return  <button className='btn btn-warning' onClick={()=>{SignOut(setEmail)}}>Log out</button>
      }
   }       

    return <>
                <Header></Header>
                 <hr></hr>
                  <div style={{paddingLeft: 50}}>
                  Welcome {"  "} {email}
                  {ShowButton()}
                  </div>
                  <hr></hr>   
                 {"   |   "}
                 <Link to="/db">Dashboard</Link> 
                 {"   |   "}
                 <Link to="/about">About Us</Link>
                 {"   |   "}    
                 <Link to="/contact">Contact Us</Link>
                 {"   |   "}    
                 <Link to="/profile">See Profile</Link>
                 <hr></hr>
                   <Switch>
                         <ProtectedRoute path="/db"
                               component={Dashboard}
                               setEmail={setEmail}/>
                         <Route path="/about" 
                                exact
                               component={About}/>
                         <Route path="/contact" 
                                exact
                               component={Contact}/>
                         <ProtectedRoute path="/profile"
                               component={Profile} setEmail={setEmail}/>
                         <ProtectedRoute path="/"
                               component={Dashboard} setEmail={setEmail}/>
                         <Route path="*" 
                               component={NotFound}/>
                   </Switch>
                 <hr></hr>
                <Footer></Footer>
            </>
}

export default Launch;
